※翌日ご希望のお荷物も遅れが生じる場合がございますので、予めご了承ください。</p>--->

　入り数: 100ml<br>
  <br>
  プリント、印刷物を薄いフィルム状にする水性移転液です。<br>
  <br>
  （手順）<br>
プリント絵画を固定して絵画の表面に6回、デカール・イットを塗ります。<br>
各々15分間または透明になるまで乾燥させます。（紙が厚い場合は、6～10回程）<br>
最終回は、2時間位乾燥させます。<br>
ぬるま湯に約1時間浸して（厚紙の場合は長時間）、湯から取り出し平らな円滑な表面に絵を下にしてそのまま貼り付けます。<br>
細心の注意を払いつつ、指の腹でこすりながら紙をこすり取り除きます。<br>
デカールのフィルムが透かして見えるまで紙を取り除きます。<br>
フィルムが伸びたり破れるほど強くこすり取らないようにして下さい。<br>
乾燥後、デカールをフィルムと貼りつける表面に塗り、フィルムをローラー等で余分な液を押し出すようにして貼ります。<style type="text/css">
